    { id: 27, status: "occupied", size: "small" },
    { id: 28, status: "free", size: "large" },
    { id: 29, status: "soon_free", size: "medium" },
    { id: 30, status: "free", size: "small" },
    // Add more spots as needed
  ],
  '-2nd floor': [
    { id: 31, status: 'free', size: 'large' },
    { id: 32, status: 'occupied', size: 'small' },
    { id: 33, status: 'free', size: 'medium' },
    { id: 34, status: 'occupied', size: 'large' },
    { id: 35, status: 'free', size: 'medium' },
    { id: 36, status: 'soon_free', size: 'small' },
    { id: 37, status: 'free', size: 'small' },
    { id: 38, status: 'occupied', size: 'large' },
    { id: 39, status: 'free', size: 'medium' },
    { id: 40, status: 'soon_free', size: 'large' },
