    { id: 48, status: 'soon_free', size: 'large' },
    { id: 49, status: 'free', size: 'large' },
    { id: 50, status: 'occupied', size: 'small' },
    { id: 51, status: 'free', size: 'medium' },
    { id: 52, status: 'soon_free', size: 'small' },
    { id: 53, status: 'free', size: 'small' },
    { id: 54, status: 'occupied', size: 'medium' },
    { id: 55, status: 'soon_free', size: 'large' },
    { id: 56, status: 'free', size: 'medium' },
    { id: 57, status: 'occupied', size: 'small' },
    { id: 58, status: 'free', size: 'large' },
    { id: 59, status: 'free', size: 'medium' },
    { id: 60, status: 'occupied', size: 'large' },
    // Add more spots as needed
  ],
  '-3rd floor': [
    { id: 61, status: 'soon_free', size: 'medium' },
    { id: 62, status: 'free', size: 'large' },
    { id: 63, status: 'soon_free', size: 'small' },
    { id: 64, status: 'free', size: 'large' },
