    { id: 70, status: 'free', size: 'large' },
    { id: 71, status: 'soon_free', size: 'medium' },
    { id: 72, status: 'free', size: 'small' },
    { id: 73, status: 'occupied', size: 'large' },
    { id: 74, status: 'free', size: 'medium' },
    { id: 75, status: 'soon_free', size: 'small' },
    { id: 76, status: 'free', size: 'large' },
    { id: 77, status: 'occupied', size: 'medium' },
    { id: 78, status: 'soon_free', size: 'large' },
    { id: 79, status: 'free', size: 'small' },
    { id: 80, status: 'occupied', size: 'medium' },
    { id: 81, status: 'free', size: 'large' },
    { id: 82, status: 'soon_free', size: 'small' },
    { id: 83, status: 'free', size: 'medium' },
    { id: 84, status: 'occupied', size: 'large' },
    { id: 85, status: 'soon_free', size: 'small' },
    { id: 86, status: 'free', size: 'medium' },
    { id: 87, status: 'occupied', size: 'large' },
    { id: 88, status: 'free', size: 'small' },
    { id: 89, status: 'soon_free', size: 'large' },
    { id: 90, status: 'free', size: 'medium' },
  ],
};

function PlotPicker() {
  const [currentLevel, setCurrentLevel] = useState('-1st floor');
  const [carSize, setCarSize] = useState('medium'); // autó mérete

  const handleLevelChange = (level) => {
    setCurrentLevel(level);
  };

  const getSpotColor = (spot) => {
    if (spot.status === 'occupied') return 'red';
    if (spot.status === 'soon_free') return 'yellow';
    if (spot.status === 'free' && spot.size === carSize) return 'green';
    return 'gray';
  };

  const spots = parkingData[currentLevel];
  
  return (
    <div className="grid-container">
    <div className="left-panel">
    </div>
    <div className="right-panel">
    <div className="plot-picker-container">
      <h1>Pick a parking spot</h1>

      <div className="level-buttons">
        {levels.map((level) => (
          <button
            key={level}
            className={level === currentLevel ? 'active' : ''}
            onClick={() => handleLevelChange(level)}
          >
            {level}
          </button>
        ))}
      </div>

      <div className="parking-layout">
        {/* First 10 spots */}
        <div className="parking-container-top">
          {spots.slice(0, 10).map((spot) => (
            <div
              key={spot.id}
              className={`parking-spot ${getSpotColor(spot)}`}
            >
              {spot.id}
            </div>
          ))}
        </div>

        {/* Next 5 spots */}
        <div className="parking-container-left">
          {spots.slice(25, 30).reverse().map((spot) => (
            <div
              key={spot.id}
              className={`parking-spot ${getSpotColor(spot)}`}
            >
              {spot.id}
            </div>
          ))}
        </div>

        {/* Next 10 spots */}
        <div className="parking-container-bottom">
          {spots.slice(15, 25).reverse().map((spot) => (
            <div
              key={spot.id}
              className={`parking-spot ${getSpotColor(spot)}`}
            >
              {spot.id}
            </div>
          ))}
        </div>

        {/* Last 5 spots */}
        <div className="parking-container-right">
          {spots.slice(10, 15).map((spot) => (
            <div
              key={spot.id}
              className={`parking-spot ${getSpotColor(spot)}`}
            >
              {spot.id}
            </div>
          ))}
        </div>
        <div className="parking-container-middle">
          <div className='lift-base'>
            <div className='lift-top'></div>
            <div className='lift-bottom'></div>
          </div>
        </div>
      </div>
    </div>
    </div>
    </div>
  );
}

export default PlotPicker;
